class JsimpleProxy extends Proxy {
    /**
     * Builds a proxy on a Jsimple instance
     *
     * @param {Jsimple} [jsimple] A Jsimple instance to wrap in a Proxy
     */
    constructor(jsimple) {
        let handler = {
