/** @test {Decorator} */
describe("Decorator", () => {
    let jsimple;

    beforeEach(() => jsimple = new Jsimple());

    beforeEach(() => {
        let should = require("should");

        should.extend("then", Proxy.prototype);
        should.extend("Boolean", Proxy.prototype);
    });

